export const EditForm = ({
    currentTodo,
    setIsEditing,
    onEditInputChange,
    onEditFormSubmit,
}) => {
    return (
        <form onSubmit={onEditFormSubmit}>
            <h2>Edit Todo</h2>
            <label htmlFor="editTodo">Edit todo: </label>
            <input
                name="editTodo"
                type="text"
                placeholder="Edit todo"
                value={currentTodo.text}
                onChange={onEditInputChange}
            />
        </form>
    )
}
